import React from "react";
import { GoogleMap, LoadScript, Marker } from "@react-google-maps/api";

const mapStyles = {
  height: "400px",
  width: "100%",
};

const defaultCenter = { lat: 42.875, lng: -8.544 }; // 📍 Centro de Galicia

const GaliciaMap = ({ alertData }) => {
  return (
    <LoadScript googleMapsApiKey="TU_API_KEY_AQUÍ">
      <GoogleMap mapContainerStyle={mapStyles} center={defaultCenter} zoom={8}>
        {alertData.map((alert, index) => (
          alert.lat && alert.lng && (
            <Marker key={index} position={{ lat: alert.lat, lng: alert.lng }} />
          )
        ))}
      </GoogleMap>
    </LoadScript>
  );
};

export default GaliciaMap;
